tensor = tokenizer.tokenize(data)
dim = tensor.shape[1]
model = Sequential(
    AVNNType1Linear(input_dim=dim, output_dim=dim*2),
    AVNNType2Linear(input_dim=dim*2, output_dim=dim),
    AVNNLinearBlock(input_dim=dim),
    AVNNLinearToConv2dBridge(5, 3, 3),
    AVNNConv2dBlock(in_channels=5, out_channels=5),
    AVNNConv2dToLinarBridge(),
    AVNNLinearBlock(input_dim=dim)
    #MappingCondenser()
)

out = model(tensor.float())

print(out, out.shape)